import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 54.1-2950 Requisite training and educational achievements of assistants.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-2950.md","filePath":"vacode/54.1-2950.md"}'),n={name:"vacode/54.1-2950.md"},s=i('<h1 id="§-54-1-2950-requisite-training-and-educational-achievements-of-assistants" tabindex="-1">§ 54.1-2950 Requisite training and educational achievements of assistants. <a class="header-anchor" href="#§-54-1-2950-requisite-training-and-educational-achievements-of-assistants" aria-label="Permalink to &quot;§ 54.1-2950 Requisite training and educational achievements of assistants.&quot;">​</a></h1><p>The Board shall establish a testing program to determine the training and educational achievements of the physician assistant or the Board may accept other evidence, such as experience or completion of an approved training program, in lieu of testing and shall establish this as a prerequisite for approval of the licensee&#39;s application.</p><p>Pending the outcome of the next examination administered by the National Commission on Certification of Physician Assistants, the Board may grant provisional licensure to graduates of physician assistants curricula that are approved by the Accreditation Review Commission on Education for the Physician Assistant. Such provisional licensure shall be granted at the discretion of the Board.</p><p>1973, c. 529, § 54-281.7; 1984, c. 46; 1988, c. 765; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0806" target="_blank" rel="noreferrer">806</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0144" target="_blank" rel="noreferrer">144</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0450" target="_blank" rel="noreferrer">450</a>.</p>',4),o=[s];function r(c,l,h,d,p,f){return a(),t("div",null,o)}const g=e(n,[["render",r]]);expor